      Hint: ExtendedContent
      Value: "Aqueon LED boxed fish tank kits offer a complete habitat with vibrant LED lighting to bring the aquarium to life. The energy saving low-profile hood features cool white LEDs for total illumination, a convenient feeding door in the front and breakout sections in the back for popular accessories. Complete with high-quality components needed for a healthy aquatic environment including a heater, QuietFlow LED PRO power filter, fish food, water conditioner, fish net and a stick-on thermometer. A complete guide is also included to walk you through the process of proper aquarium setup. The Aqueon QuietFlow LED PRO filter will make maintenance easy. The LED on the top of the filter will start flashing when it's time to change the cartridge - no more guessing! In addition, the enhanced five-stage filtration and included ammonia specialty filter pad will help keep your aquarium water clean and your fish healthy. Fish, gravel and decor are sold separately."
